import styled from 'styled-components'

export const Wrapper = styled.div`
  z-index: 900;
  flex-shrink: 0;
  position: sticky;
  top: 0;
  width: 100%;

  display: flex;
  justify-content: center;
  background-color: #ffffff;

  ::after {
    content: '';
    width: 50%;

    background-color: red;
  }
`
